import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";
import logo from "../images/dazzling.jpg";

function Homepage() {
  return (
    <div
      style={{
        position: "absolute",
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        backgroundImage: `url(${logo})`,
        backgroundPosition: "center",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
      }}
    >
      <div style={{ margin: "24px" }}>
        <div
          style={{
            position: "absolute",
            right: "24px",
          }}
        >
          <Link to="/login">
            <button
              style={{
                backgroundColor: "#1200b8",
                color: "#ffffff",
                padding: "5px",
              }}
            >
              Login
            </button>
          </Link>
        </div>
        <div style={{ position: "relative" }}>
          <h1
            style={{
              color: "#004cff",
              fontSize: "100px",
              margin: 0,
              padding: 0,
            }}
          >
            인뱅
          </h1>
          <h2
            style={{
              color: "#004cff",
              position: "absolute",
              top: "90px",
              left: "150px",
              transform: "rotate(-24deg)",
            }}
          >
            In-Bang
          </h2>
        </div>
        <br />
        <p
          style={{
            color: "#004cff",
            border: "2px solid #004cff",
            borderRadius: "5px",
            padding: "10px",
            textAlign: "center",
          }}
        >
          Are you ready to watch exciting movies? Click the box below to get you
          started!
        </p>
        <p style={{ color: "#004cff" }}>
          <br />
          Website still under development, for more details visit
          localhost:3000/subscription
        </p>
        <Link to="/login">
          <button
            style={{
              backgroundColor: "#1200b8",
              color: "#ffffff",
              padding: "5px",
            }}
          >
            Get Started →
          </button>
        </Link>
      </div>
    </div>
  );
}

export default Homepage;
